import React from 'react';



//components
import GridContainer from './components/Grid/GridContainer'
import Card from './components/Card/Card'

import './App.css';

function App() {
  return (
    <div className="App">

      <GridContainer>
        <Card>
          <h1>Login</h1>
        </Card>
      </GridContainer>

    </div>
  );
}

export default App;
